3b\u044c\u0434\u043c\u0430\u0440\u0448\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%A8%D0%B5%D1%80%D0%B5%D0%BC%D0%B5%D1%82%D0%B5%D0%B2\" class=\"mw-redirect\" title=\"\u0411\u043e\u0440\u0438\u0441 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447 \u0428\u0435\u0440\u0435\u043c\u0435\u0442\u0435\u0432\">\u0411\u043e\u0440\u0438\u0441 \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447 \u0428\u0435\u0440\u0435\u043c\u0435\u0442\u0435\u0432<\/a> \u0432\u044a\u0435\u0445\u0430\u043b \u0432 \u043f\u043e\u0431\u0435\u0436\u0434\u0435\u043d\u043d\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B3%D0%B0\" title=\"\u0420\u0438\u0433\u0430\">\u0420\u0438\u0433\u0443.<\/a> \u0412 \u0442\u043e\u0442 \u0436\u0435 \u0434\u0435\u043d\u044c \u0447\u043b\u0435\u043d\u044b \u0440\u0438\u0436\u0441\u043a\u043e\u0433\u043e \u043c\u0430\u0433\u0438\u0441\u0442\u0440\u0430\u0442\u0430 \u043f\u0440\u0438\u0441\u044f\u0433\u043d\u0443\u043b\u0438 \u043d\u0430 \u0432\u0435\u0440\u043d\u043e\u0441\u0442\u044c \u0440\u0443\u0441\u0441\u043a\u043e\u043c\u0443 \u0446\u0430\u0440\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80_I\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1789_%D0%B3%D0%BE%D0%B4\" title=\"1789 \u0433\u043e\u0434\">1789<\/a>&#160;\u2014 \u0432\u043e\u0441\u0441\u0442\u0430\u0432\u0448\u0438\u043c\u0438 \u043f\u0430\u0440\u0438\u0436\u0430\u043d\u0430\u043c\u0438 \u0432\u0437\u044f\u0442\u0430 \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%81%D1%82%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0430\u0441\u0442\u0438\u043b\u0438\u044f\">\u0411\u0430\u0441\u0442\u0438\u043b\u0438\u044f<\/a>. \u042d\u0442\u043e \u0441\u0442\u0430\u043b\u043e \u043d\u0430\u0447\u0430\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1860_%D0%B3%D0%BE%D0%B4\" title=\"1860 \u0433\u043e\u0434\">1860<\/a>&#160;\u2014 \u0441\u043e\u0437\u0434\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B1%D0%B0%D0%BD%D0%BA\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0431\u0430\u043d\u043a\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0431\u0430\u043d\u043a<\/a> \u0420\u043e\u0441\u0441\u0438\u0438 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u043e\u0435 \u0432\u043e\u0441\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%82%D1%82%D0%B5%D1%80%D1%85%D0%BE%D1%80%D0%BD\" title=\"\u041c\u0430\u0442\u0442\u0435\u0440\u0445\u043e\u0440\u043d\">\u041c\u0430\u0442\u0442\u0435\u0440\u0445\u043e\u0440\u043d<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f\u044b<\/a>) \u0432\u044b\u0441\u043e\u0442\u043e\u0439 4478&#160;\u043c \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0447\u043b\u0435\u043d \u0430\u043d\u0433\u043b\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B8%D0%BC%D0%BF%D0%B5%D1%80,_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4\" title=\"\u0423\u0438\u043c\u043f\u0435\u0440, \u042d\u0434\u0443\u0430\u0440\u0434\">\u042d\u0434\u0443\u0430\u0440\u0434 \u0423\u0438\u043c\u043f\u0435\u0440<\/a> (Edward Whymper). \u0423\u0441\u043f\u0435\u0445 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 \u0431\u044b\u043b \u043e\u043c\u0440\u0430\u0447\u0451\u043d \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u0435\u0439: \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0441\u043f\u0443\u0441\u043a\u0430 \u0447\u0435\u0442\u0432\u0435\u0440\u043e \u0435\u0451 \u0447\u043b\u0435\u043d\u043e\u0432 \u043f\u043e\u0433\u0438\u0431\u043b\u0438. \u0412\u0435\u0440\u043d\u0443\u043b\u0438\u0441\u044c \u043b\u0438\u0448\u044c \u043e\u0442\u0435\u0446 \u0438 \u0441\u044b\u043d \u0422\u0430\u0443\u0433\u0432\u0430\u043b\u044c\u0434\u0435\u0440\u044b, \u0438 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d \u042d\u0434\u0443\u0430\u0440\u0434 \u0423\u0438\u043c\u043f\u0435\u0440.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 \u0412 \u043a\u0430\u0440\u044c\u0435\u0440\u0435 \u0432 \u0420\u044d\u0434\u0445\u0438\u043b\u043b (\u0433\u0440-\u0432\u043e \u0421\u044e\u0440\u0440\u0435\u0439, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a>) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%8C,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4_%D0%91%D0%B5%D1%80%D0%BD%D1%85%D0%B0%D1%80%D0%B4\" class=\"mw-redirect\" title=\"\u041d\u043e\u0431\u0435\u043b\u044c, \u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u0411\u0435\u0440\u043d\u0445\u0430\u0440\u0434\">\u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u041d\u043e\u0431\u0435\u043b\u044c<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%B8%D1%82\" title=\"\u0414\u0438\u043d\u0430\u043c\u0438\u0442\">\u0434\u0438\u043d\u0430\u043c\u0438\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1894_%D0%B3%D0%BE%D0%B4\" title=\"1894 \u0433\u043e\u0434\">1894<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2\" title=\"\u041b\u044c\u0432\u043e\u0432\">\u041b\u044c\u0432\u043e\u0432\u0435<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a> \u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043c\u0430\u0442\u0447 (\u043a\u043e\u043c\u0430\u043d\u0434\u044b \u0438\u0437 \u041b\u044c\u0432\u043e\u0432\u0430 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B0%D0%BA%D0%BE%D0%B2\" title=\"\u041a\u0440\u0430\u043a\u043e\u0432\">\u041a\u0440\u0430\u043a\u043e\u0432\u0430<\/a> \u043f\u0440\u043e\u0432\u0435\u043b\u0438 \u043d\u0430 \u043f\u043e\u043b\u0435 7 \u043c\u0438\u043d\u0443\u0442 \u0434\u043e \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0433\u043e\u043b\u0430).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_%D0%B2_%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5%D0%BC_%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B5_(1896)\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 \u0432 \u041d\u0438\u0436\u043d\u0435\u043c \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0435 (1896)\">\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0435 \u0432 \u041d\u0438\u0436\u043d\u0435\u043c \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0435<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\">\u043f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c<\/a> \u043e\u0442\u0441\u0442\u0430\u0432\u043d\u043e\u0433\u043e \u043b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D0%B8%D0%B7%D0%BE%D0%B1%D1%80%D0%B5%D1%82%D0%B0%D1%82%D0%B5%D0%BB%D1%8C)\" title=\"\u042f\u043a\u043e\u0432\u043b\u0435\u0432, \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447 (\u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c)\">\u0415. \u042f\u043a\u043e\u0432\u043b\u0435\u0432\u0430<\/a> \u0438 \u0445\u043e\u0437\u044f\u0438\u043d\u0430 \u043a\u0430\u0440\u0435\u0442\u043d\u044b\u0445 \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B5%D0%B7%D0%B5,_%D0%9F%D1%91%D1%82%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0424\u0440\u0435\u0437\u0435, \u041f\u0451\u0442\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u041f\u0435\u0442\u0440\u0430 \u0424\u0440\u0435\u0437\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D1%8C%D0%B5\" title=\"\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435\">\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0435\u043d\u044c\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u0432\u044b\u0445\u043e\u0434\u043d\u044b\u043c \u0434\u043d\u0451\u043c.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u043f\u043e\u043f\u0435\u0447\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043e \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0442\u0440\u0435\u0437\u0432\u043e\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0435\u0446\u0438\u044f\">\u0412\u0435\u043d\u0435\u0446\u0438\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%A1%D0%B0%D0%BD-%D0%9C%D0%B0%D1%80%D0%BA%D0%BE\" class=\"mw-redirect\" title=\"\u041f\u043b\u043e\u0449\u0430\u0434\u044c \u0421\u0430\u043d-\u041c\u0430\u0440\u043a\u043e\">\u043f\u043b\u043e\u0449\u0430\u0434\u0438 \u0421\u0430\u043d-\u041c\u0430\u0440\u043a\u043e<\/a> \u043e\u0431\u0440\u0443\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%BE%D0%BA%D0%BE%D0%BB%D1%8C%D0%BD%D1%8F\" title=\"\u041a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u044f\">\u043a\u043e\u043b\u043e\u043a\u043e\u043b\u044c\u043d\u044f<\/a>-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D0%BB%D0%B0_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D0%B0_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%9C%D0%B0%D1%80%D0%BA%D0%B0\" title=\"\u041a\u0430\u043c\u043f\u0430\u043d\u0438\u043b\u0430 \u0441\u043e\u0431\u043e\u0440\u0430 \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041c\u0430\u0440\u043a\u0430\">\u043a\u0430\u043c\u043f\u0430\u043d\u0438\u043b\u0430<\/a>&#160;\u2014 \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u0438\u043c\u0432\u043e\u043b\u043e\u0432 \u0433\u043e\u0440\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0418\u043d\u0434\u0435\u0439\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D0%BB%D0%B0%D1%85%D0%BE%D0%BC%D0%B0\" title=\"\u041e\u043a\u043b\u0430\u0445\u043e\u043c\u0430\">\u041e\u043a\u043b\u0430\u0445\u043e\u043c\u044b<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0438 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0438\u043d\u0434\u0435\u0439\u0441\u043a\u043e\u0433\u043e \u0448\u0442\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%BA%D0%B2%D0%BE%D0%B9%D1%8F_(%D1%88%D1%82%D0%B0%D1%82)\" title=\"\u0421\u0435\u043a\u0432\u043e\u0439\u044f (\u0448\u0442\u0430\u0442)\">\u0421\u0435\u043a\u0432\u043e\u0439\u044f<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410\">\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410<\/a> \u043e\u0442\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043f\u0440\u0438\u0437\u043d\u0430\u0432\u0430\u0442\u044c \u0435\u0433\u043e).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D1%81%D1%82%D0%B0%D0%BD_%D0%A2%D1%86%D0%B0%D1%80%D0%B0\" title=\"\u0422\u0440\u0438\u0441\u0442\u0430\u043d \u0422\u0446\u0430\u0440\u0430\">\u0422\u0440\u0438\u0441\u0442\u0430\u043d \u0422\u0446\u0430\u0440\u0430<\/a> \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%8E%D1%80%D0%B8%D1%85\" title=\"\u0426\u044e\u0440\u0438\u0445\">\u0426\u044e\u0440\u0438\u0445\u0435<\/a> \u043c\u0430\u043d\u0438\u0444\u0435\u0441\u0442 \u0434\u0430\u0434\u0430\u0438\u0441\u0442\u043e\u0432. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B4%D0%B0%D0%B8%D0%B7%D0%BC\" title=\"\u0414\u0430\u0434\u0430\u0438\u0437\u043c\">\u0414\u0430\u0434\u0430\u0438\u0437\u043c<\/a>, \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0438\u0439\u0441\u044f \u0432 \u0441\u0440\u0435\u0434\u0435 \u0430\u043d\u0430\u0440\u0445\u0438\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0439 \u0438\u043d\u0442\u0435\u043b\u043b\u0438\u0433\u0435\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u044f\">\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0438\u0438<\/a> \u043a\u0430\u043a \u043f\u0440\u043e\u0442\u0435\u0441\u0442 \u043f\u0440\u043e\u0442\u0438\u0432 1-\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b, \u0431\u044b\u043b \u0441\u0432\u043e\u0435\u043e\u0431\u0440\u0430\u0437\u043d\u044b\u043c \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c \u0438\u0440\u0440\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u043c \u0445\u0443\u043b\u0438\u0433\u0430\u043d\u0441\u0442\u0432\u043e\u043c \u0438 \u0432\u044b\u0440\u0430\u0436\u0430\u043b\u0441\u044f \u0432 \u0431\u0435\u0441\u0441\u043c\u044b\u0441\u043b\u0435\u043d\u043d\u044b\u0445 \u0441\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u044f\u0445 \u0441\u043b\u043e\u0432 \u0438 \u0437\u0432\u0443\u043a\u043e\u0432, \u0432 \u043a\u0430\u0440\u0430\u043a\u0443\u043b\u044f\u0445, \u043d\u0430\u0441\u0442\u0435\u043d\u043d\u044b\u0445 \u043d\u0430\u0434\u043f\u0438\u0441\u044f\u0445, \u043f\u0441\u0435\u0432\u0434\u043e\u0447\u0435\u0440\u0442\u0435\u0436\u0430\u0445, \u043d\u0430\u0431\u043e\u0440\u0435 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0445 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0430 \u0441\u0432\u043e\u044e \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u044e.<\/li><li>\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b\u043e \u0434\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044e \u043e \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u0427\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%9A%D0%9A%D0%90\" class=\"mw-redirect\" title=\"\u0420\u041a\u041a\u0410\">\u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0430\u0440\u043c\u0438\u0438<\/a> \u0437\u0430\u043d\u044f\u043b\u0438 \u0441\u0442\u043e\u043b\u0438\u0446\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u044b<\/a> \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\">\u0412\u0438\u043b\u044c\u043d\u044e\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a><ul><li>\u041d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%